import React from 'react';
import {NavLink} from 'react-router-dom'

const Navbar = () => {


    return (
        <nav className="container">
            <div  className="blocNav">
            <ul>
                <NavLink exact to='./'>
                <li>Acceuil</li>
                 </NavLink>
                <li>Services</li>
                <li>Gallery</li>
                <li>Avis</li>
                <li>Contact</li>

            </ul>
            </div>

        </nav>
    );
};

export default Navbar;
